import './App.css';
import SideBar from './Components/sidenavbar/SideBar';



function App() {
  return (
    <div className="App">
      <SideBar />
      <ul>
      {SideBarNavs.map((val, key) => {
        return(
          <li key={key} onClick = {()=> {
            window.location.pathname = val.link;
            }}>
            {""}
            <div> {val.icon}</div>
            <div>{val.title}</div>
          </li>
        )
      })} 
      </ul>
    </div>
  );
}

export default App;
